import Envitonment from './../const/env';

export default class Env {
    static getFullName(envCode) {
        let name = 'Local dev';
        if (envCode === Envitonment.DEVELOPMENT) {
            name = 'Development';
        }
        if (envCode === Envitonment.PREPRODUCTION) {
            name = 'Preproduction/QA';
        }
        if (envCode === Envitonment.PRODUCTION) {
            name = 'Production';
        }
        return name;
    }
}
